import React, { Component } from 'react';

class ComingSoon extends Component {
    render() { 
        return ( 
            <div className="bgimg">
                <div className="topleft">
                    <p>Deliveries</p>
                </div>
                <div className="middle">
                    <h1>COMING SOON</h1>
                    <hr></hr>
                </div>
                <div className="bottomleft">
                    <p>FARMATR</p>
                </div>
            </div>
         );
    }
}

export default ComingSoon;
